import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';


const ChatEvents = props => (
  <tr>
    <td>{props.ChatEvent.type}</td>
    <td>{props.ChatEvent.user}</td>
    <td>{props.ChatEvent.time}</td>
    <td>{props.ChatEvent.EventId} </td>
    <td>{props.ChatEvent.Ppid}</td>
    <td>{props.ChatEvent.date.substring(0,10)}</td>
  </tr>
)



class eventlog extends Component{
    constructor(props){
        super(props);
        
        this.eventlog =this.eventlog.bind(this)
        this.state = {eventlog: []};
    }


    componentDidMount() {
        axios.get('http://localhost:5000/api/')
          .then(response => {
            this.setState({ eventlog: response.data })
          })
          .catch((error) => {
            console.log(error);
          })
      }

    render(){
        return(
        <div>
        <ChatEvents/>
        </div>
        )
    }

}
export default eventlog;
